clear,clctimp=0:6;viteza=[15 30 75 60 60 40 55];t=[0.5 3.2 5.7];vy_liniar=interp1(timp,viteza,t,'linear')vy_lagrange=P1(timp, viteza,t)vy_hermite= interpl(timp,viteza,t,'cubic')vy_spline=spline(timp,viteza,t)p2=polyfit(timp,viteza,2)vy_cmmp2=polyval(p2,t);p5=polyfit(timp,viteza,5)vy_cmmp5=polyval(p5,t)hold onplot(timp, viteza,'o')plot(t,vy_liniar,'m',t,vy_lagrange,'c',t,vy_hermite,'g')plot(t,vy_spline,'k--',t,vy_cmmp2,'r--',t,vy_cmmp5,'b:')legend('punctele','liniara','lagrange','hermit','spline','cmmp2','cmmp5')hold off